import React from 'react'

function Display(props) {
  return (
    <div>{props.list.transaction.map((item)=>{
      return item.amount !==0 ? (<div>{item.amount+" "+item.desc}</div>):null
    })}
  {props.list.total !== 0 && <div>Total: {props.list.total}</div>}
  </div>
  )
}

export default Display
